Information
------------------------------
Down Syndrome is by far the most common genetically inherited disorder. 1 in 800 babies born in the UK is Downs - a statistic that has remained constant over the decades, in spite of the increased incidence of Downs pregnancies due to mothers having babies later in life.
Ups and Downs examines why this should be and, explores the life chances of a Downs baby born today.
Amongst those we meet, 13 year old Galina. Will she be able to fulfil her potential in a secondary education? An education, although much more enlightened than in previous decades, that still has a culture opposing some of her educational choices. Parents Aonghas and Gerda discuss their hopes and fears for the future.
Ups &amp; Downs will shock, amaze, educate, and hopefully give a greater understanding into the lives of 1 in 800 of our population.

